let counter = 0
function makeSquares () {
    let trigger = true
    for (let x=0; x<36; x++) {  
            let box = document.createElement('div')        
            let img = document.createElement('img')                      
            box.setAttribute('id', x)                                   
            trigger ? img.src = randomAssign (pictures,18) : img.src = randomAssign (pictures1,18)           
            box.appendChild(img)                                         
            container.appendChild(box)  
            trigger = !trigger  
            box.addEventListener('click', playInProgress)        
        }           
}
makeSquares ()


function randomAssign (arg, num) {
    for (let y=0; y<num; y++) {
        let randomNum = arg[Math.floor(Math.random() * arg.length)]
        let index = arg.indexOf(randomNum)        
        arg.splice(index, 1)        
        return randomNum
    }   
}

function playInProgress (event) {       
        if (trigger) { 
            selected = event.target.id
            img1 = event.target.children[0]
            console.log(event);
            if (!event.target.children[0].classList.contains('perfect')) {                          
                img1.classList.contains('perfect') ? img1.classList.remove('perfect') : null 
                img1.style.display = 'block'
                trigger = !trigger            
                counter++                               
            }        
        } else if (event.target.id != selected) {
            img2 = event.target.children[0]
            if (!event.target.children[0].classList.contains('perfect')) {                            
                img2.classList.contains('perfect') ? img2.classList.remove('perfect') : null 
                img2.style.display = 'block'
                trigger = !trigger            
                counter ++
            }    
        }
        if (counter == 2) {
            cancelClick()
            setTimeout(seewhatsUp, 1200)
        }
}
               
  


function seewhatsUp () {  
    container.classList.remove('hey')  
    if (img1.src == img2.src) {
        img1.classList.add('perfect')
        img2.classList.add('perfect')
    } else {
        img1.style.display = 'none'
        img2.style.display = 'none'        
    }
    counter = 0
}

function cancelClick () {
   container.classList.add('hey')
}

function playAgain () {
    location.reload();

}
 
       